import React from 'react'
import {ImageError, TitleError, GoToHomeErrorPage} from './styled'

const ErrorPage = () => {
    return(
        <div>
            <TitleError>SORRY</TitleError>
           <ImageError/>
           <TitleError>Page not found</TitleError>
           <GoToHomeErrorPage> Go home page</GoToHomeErrorPage>

        </div>
    )
}
export default ErrorPage
